import logo from "./images/new_лого.png"
import {Fragment} from "react";

function Logotype() {
    return (
        <Fragment>
            <img src={logo} alt="логотип" style="position:relative; left:10px;"/>
        </Fragment>
    );
}

export default Logotype;
